import React from "react";
import { BrowserRouter as Router, Route, Routes,createBrowserRouter } from 'react-router-dom';
import RootLayout from "./components/RootLayout/RootLayout";
import Assignment1 from "./components/Assignment1/asssignment1";
import Assignment2 from "./components/Assignment2/assignment";
import Assignment3 from "./components/Assignment3/assignment";
import Assignment4 from "./components/Assignment4/assignment";


function App() {

  let router = createBrowserRouter([
    {
      path:'',
      element:<RootLayout />,
      children:[
        {
          path:'/Assignment1',
          element:<Assignment1 />,
        },
        {
          path:'/Assignment2',
          element:<Assignment2 />,
        },
        {
          path:'/Assignment3',
          element:<Assignment3 />
        },
        {
          path:'/Assignment4',
          element:<Assignment4 />
        }
      ]
    }
  ])

  return (
    <div className="w-screen overflow-hidden">
      <Router>
        <Routes>
          <Route path="/*" element={router} />
        </Routes>
      </Router>
    </div>
  );

}

export default App;
